import React, {useEffect} from 'react';
import {Div, Input, Button, Form} from './search';
import {SearchOutlined} from '@ant-design/icons';
import axios from "axios";

const Search = () => {
    const callTagData = async () => {
        await axios.get('/page/hashtag')
            .then((res) => {
                console.log(res)
            })
    }

    useEffect(() => {
        callTagData()
    }, [])

    const onChagge = async (e) => {
        await axios.post('/page/hashtag', e.target.value);
    }

    return (
        <Div>
            <Form id="hashtag-form">
                <Input onChange={onChagge} type="text" name="hashtag" placeholder='검색' />
                <Button>취소</Button>
            </Form>

        </Div>
    );
};

export default Search;
